#include <bits/stdc++.h>using namespace std;typedef long long ll; inline void solve() {    int n , m ;    cin >> n >> m ;    // vector<int> a(n) , b (m) ;    // for(auto & x : a) cin >> x ;    // for(auto & x : b) cin >> x ;    // int ans = 0 ;     // Using multiset to maintain reverse sorted order and allow duplicates    multiset<int, greater<int>> a, b ;       for(int i = 0 ; i < n ; i++) {        int x ; cin >> x ;        a.insert(x) ;    }    for(int i = 0 ; i < m ; i++) {        int x ; cin >> x ;        b.insert(x) ;    }    // cout << "debug: " ;    // for(auto x : a) cout << x << " " ;    // cout << "\n" ;    // for(auto x : b) cout << x << " " ;    // cout << "\n" ;    // return ;     bool turn = true ; // alice's turn     while(a.size() && b.size() ) {        auto ita = a.begin() ;        auto itb = b.begin() ;        if(turn) {            // decrease biggeset from b using biggest from a            if(*ita >= *itb) {                b.erase(itb) ;            } else {                int val = *itb - *ita ;                b.erase(itb) ;                b.insert(val) ;            }        }        else {            // decrease biggest from a using biggest from b            if(*itb >= *ita) {                a.erase(ita) ;            } else {                int val = *ita - *itb ;                a.erase(ita) ;                a.insert(val) ;            }        }        turn = !turn ;    }     if(a.size()) {        cout << "Alice\n" ;    } else {        cout << "Bob\n" ;    }} int main() {#ifndef ONLINE_JUDGE	freopen("Error.txt", "w", stderr);#endif 	int t = 1;	cin >> t; 	while (t--) {		solve(); 	}}